import React, {Component} from 'react';
import Aslide from "./Aslide";

class Slider_top extends Component {
    render() {
        return (
            <div>
                <ul>
                  <Aslide/>
                  <Aslide/>
                  <Aslide/>
                </ul>
            </div>
        );
    }
}

export default Slider_top;
